import React, { useState, useEffect } from 'react';
import axios from 'axios';

const MarksForm = () => {
  const [telugu, setTelugu] = useState('');
  const [hindi, setHindi] = useState('');
  const [english, setEnglish] = useState('');
  const [maths, setMaths] = useState('');
  const [science, setScience] = useState('');
  const [social, setSocial] = useState('');
  const [studentId, setStudentId] = useState('');
  const [students, setStudents] = useState([]);

  useEffect(() => {
    fetchStudents();
  }, []);

  const fetchStudents = async () => {
    try {
      const response = await axios.get('http://localhost:8080/showAllStudents');
      if (response.status === 200) {
        setStudents(response.data);
      } else {
        console.error('Error fetching students');
      }
    } catch (error) {
      console.error('Network error:', error);
    }
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    const marksData = {
      telugu: parseInt(telugu),
      hindi: parseInt(hindi),
      english: parseInt(english),
      maths: parseInt(maths),
      science: parseInt(science),
      social: parseInt(social),
      studentId: {
        studentId: parseInt(studentId)
      }
    };

    try {
      await axios.post('http://localhost:8080/addMarks', marksData);
      console.log('Marks added successfully!');
      // Reset form values
      setTelugu('');
      setHindi('');
      setEnglish('');
      setMaths('');
      setScience('');
      setSocial('');
      setStudentId('');
      fetchStudents();
    } catch (error) {
      console.error('Error adding marks:', error);
    }
  };

  return (
    <div>
      <h2>Add Marks</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="telugu">Telugu:</label>
          <input
            type="number"
            id="telugu"
            value={telugu}
            onChange={(event) => setTelugu(event.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="hindi">Hindi:</label>
          <input
            type="number"
            id="hindi"
            value={hindi}
            onChange={(event) => setHindi(event.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="english">English:</label>
          <input
            type="number"
            id="english"
            value={english}
            onChange={(event) => setEnglish(event.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="maths">Maths:</label>
          <input
            type="number"
            id="maths"
            value={maths}
            onChange={(event) => setMaths(event.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="science">Science:</label>
          <input
            type="number"
            id="science"
            value={science}
            onChange={(event) => setScience(event.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="social">Social:</label>
          <input
            type="number"
            id="social"
            value={social}
            onChange={(event) => setSocial(event.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="studentId">Student ID:</label>
          <select
            id="studentId"
            value={studentId}
            onChange={(event) => setStudentId(event.target.value)}
            required
          >
            <option value="">Select a student</option>
            {students.map((student) => (
              <option key={student.studentId} value={student.studentId}>
                {student.studentName}
              </option>
            ))}
          </select>
        </div>
        <button type="submit">Add Marks</button>
      </form>
    </div>
  );
};

export default MarksForm;
